// src/App.js
import React from 'react';
import { BrowserRouter, Routes, Route, NavLink } from 'react-router-dom';

import CampaignPage from './pages/CampaignPage';
import DashboardPage from './pages/DashboardPage';
import DisparoPage from './pages/DisparoPage';
import HistoryPage from './pages/HistoryPage';
import SuggestionPage from './pages/SuggestionPage';
import TemplatePage from './pages/TemplatePage';
import UploadPage from './pages/UploadPage';

import JourneysPage from './pages/JourneysPage';
import JourneyBuilder from './pages/JourneyBuilder';
import TemplatesCompliancePage from './pages/TemplatesCompliancePage';

const App = () => {
  const linkStyle = ({ isActive }) => ({
    display: 'block',
    color: isActive ? '#0061d5' : '#0D122B',
    textDecoration: 'none',
    fontWeight: 600,
    marginBottom: '1rem',
  });

  return (
    <BrowserRouter>
      <div style={{ display: 'flex' }}>
        <nav>
          <NavLink to="/upload" style={linkStyle}>Upload Base</NavLink>
          <NavLink to="/disparo" style={linkStyle}>Disparar Campanha</NavLink>
          <NavLink to="/template" style={linkStyle}>Criar Template</NavLink>
          <NavLink to="/historico" style={linkStyle}>Histórico</NavLink>
          <NavLink to="/dashboard" style={linkStyle}>Dashboard</NavLink>
          <NavLink to="/sugestoes" style={linkStyle}>Sugestões de IA</NavLink>
          <NavLink to="/journeys" style={linkStyle}>Journeys</NavLink>
          <NavLink to="/journeys/builder" style={linkStyle}>Builder</NavLink>
          <NavLink to="/templates/compliance" style={linkStyle}>Template Compliance</NavLink>
        </nav>

        <div style={{ marginLeft: '180px', padding: '2rem', width: '100%' }}>
          <Routes>
            {/* páginas já existentes */}
            <Route path="/upload" element={<UploadPage />} />
            <Route path="/disparo" element={<DisparoPage />} />
            <Route path="/template" element={<TemplatePage />} />
            <Route path="/historico" element={<HistoryPage />} />
            <Route path="/dashboard" element={<DashboardPage />} />
            <Route path="/sugestoes" element={<SuggestionPage />} />
            <Route path="/campanha" element={<CampaignPage />} />

            {/* ROTAS QUE FALTAVAM */}
            <Route path="/journeys" element={<JourneysPage />} />
            <Route path="/journeys/builder" element={<JourneyBuilder />} />
            <Route path="/templates/compliance" element={<TemplatesCompliancePage />} />

            {/* fallback */}
            <Route path="*" element={<div style={{ padding: 16 }}>Página não encontrada.</div>} />
          </Routes>
        </div>
      </div>
    </BrowserRouter>
  );
};

export default App;
